import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

import Card from './Card';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>

        <Card />
        </header>


      </div>
    );
  }
}

export default App;
